import React from "react";
import "../styles/Tabs.css";
import TabCard from "../template-parts/TabCard";

const Tabs = ({ title, text, tabs, sectioncounter }) => {
  console.log(tabs);
  return (
    <div className="container pt-5 pb-5">
      {title && (
        <div className="row">
          <h2 className="text-center">{title}</h2>
        </div>
      )}
      {text && (
        <div
          className="row text-center"
          dangerouslySetInnerHTML={{ __html: text }}
        />
      )}

      {/* General Tabs */}
      <ul className="nav nav-pills mb-3" id={`pills-tab-${sectioncounter}`} role="tablist">
        {tabs?.length > 0 &&
          Object.entries(tabs).map(([key, tab], indexGEn) => (
            <li className="nav-item" role="presentation" key={key}>
              <button
                className={`nav-link ${indexGEn === 0 ? "active" : ""}`}
                id={`Gentab-${sectioncounter}-${key}`}
                data-bs-toggle="pill"
                data-bs-target={`#item-${sectioncounter}-${key}`}
                type="button"
                role="tab"
                aria-controls={`item-${sectioncounter}-${key}`}
                aria-selected={indexGEn === 0 ? "true" : "false"}
              >
                {tab.generalTabTitle}
              </button>
            </li>
          ))}
      </ul>

      <div className="tab-content generalTab" id={`pills-tabContent-${sectioncounter}`}>
        {tabs?.length > 0 &&
          Object.entries(tabs).map(([key, tab], indexSec) => (
            <div
              key={key}
              className={`tab-pane fade ${indexSec === 0 ? "show active" : ""}`}
              id={`item-${sectioncounter}-${key}`}
              role="tabpanel"
              aria-labelledby={`Gentab-${sectioncounter}-${key}`}
            >
              {/* Internal Tabs */}
              {tab?.internalTab?.length > 0 && (
                <>
                  <ul className="nav nav-pills mb-3" id={`pills-tab-int-${sectioncounter}-${key}`} role="tablist">
                    {Object.entries(tab.internalTab).map(([intKey, intTab], indexThird) => (
                      <li className="nav-item" role="presentation" key={intKey}>
                        <button
                          className={`nav-link ${indexThird === 0 ? "active" : ""}`}
                          id={`tab-int-${sectioncounter}-${key}-${intKey}`}
                          data-bs-toggle="pill"
                          data-bs-target={`#tabContentInternal-${sectioncounter}-${key}-${intKey}`}
                          type="button"
                          role="tab"
                          aria-controls={`tabContentInternal-${sectioncounter}-${key}-${intKey}`}
                          aria-selected={indexThird === 0 ? "true" : "false"}
                        >
                          {intTab.title}
                        </button>
                      </li>
                    ))}
                  </ul>

                  {/* Internal Tab Content */}
                  <div className="tab-content generalTab" id={`pills-tabContent-int-${sectioncounter}-${key}`}>
                    {Object.entries(tab.internalTab).map(([intKey, intTab], indexThird) => (
                      <div
                        key={intKey}
                        className={`tab-pane fade ${indexThird === 0 ? "show active" : ""}`}
                        id={`tabContentInternal-${sectioncounter}-${key}-${intKey}`}
                        role="tabpanel"
                        aria-labelledby={`tab-int-${sectioncounter}-${key}-${intKey}`}
                      >
                        {/* Cards Section Inside Internal Tabs */}
                        <div className="infocardTabs">
                          {intTab?.cardsInfoColumn?.length > 0 &&
                            intTab.cardsInfoColumn.map((infoCard, index) => (
                              <TabCard key={index} rows={infoCard} title={"test"}/>
                            ))}
                        </div>
                      </div>
                    ))}
                  </div>
                </>
              )}
            </div>
          ))}
      </div>
    </div>
  );
};

export default Tabs;
